package com.kuaixiu.project.entity;import java.math.BigDecimal;import java.util.Date;import com.common.base.entity.BaseEntity;/** * 维修项目实体类. *  * @CreateDate: 2016-8-24 下午10:48:53 * @version: V 1.0 */public class Project extends BaseEntity {    /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private String id;    /**     * 维修项目名称     */    private String name;    /**     * 是否适用所有机型     */    private Integer isAll;    /**     * 维修费用     */    private BigDecimal price;    /**     * 排序     */    private Integer sort;    /**     * 是否删除 0：否；1：是     */    private Integer isDel;    /**     *      */    private Date createTime;    /**     *      */    private String createUserid;    /**     *      */    private Date updateTime;    /**     *      */    private String updateUserid;    /**     * get:     */    public String getId(){        return this.id;    }    /**     * set：     */    public void setId(String id){        this.id=id;    }    /**     * get:维修项目名称     */    public String getName(){        return this.name;    }    /**     * set：维修项目名称     */    public void setName(String name){        this.name=name;    }    /**     * get:是否适用所有机型     */    public Integer getIsAll(){        return this.isAll;    }    /**     * set：是否适用所有机型     */    public void setIsAll(Integer isAll){        this.isAll=isAll;    }    /**     * get:维修费用     */    public BigDecimal getPrice(){        return this.price;    }    /**     * set：维修费用     */    public void setPrice(BigDecimal price){        this.price=price;    }        public Integer getSort() {		return sort;	}	public void setSort(Integer sort) {		this.sort = sort;	}	public Integer getIsDel() {        return isDel;    }    public void setIsDel(Integer isDel) {        this.isDel = isDel;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getCreateUserid() {        return createUserid;    }    public void setCreateUserid(String createUserid) {        this.createUserid = createUserid;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public String getUpdateUserid() {        return updateUserid;    }    public void setUpdateUserid(String updateUserid) {        this.updateUserid = updateUserid;    }}